import { Avatar, Button, Dropdown, Navbar } from 'flowbite-react';
import imgLogo from "../../resources/logoOupia.svg";
import { Link, NavLink, useLocation } from 'react-router-dom';
import "./style.scss";
import { useEffect, useState } from 'react';
import { BiBell } from "react-icons/bi"
import { BsBookmark, BsChat } from "react-icons/bs";
import { FiLogOut } from "react-icons/fi";

const Header = () => {
    // User Profile or SignIn Button

    const user = {
        fullName: "Nguyễn Kim Bảo Ngân",
        avatar: "https://scontent.fsgn3-1.fna.fbcdn.net/v/t39.30808-1/350118519_479477941022130_6544855667418265188_n.jpg?stp=dst-jpg_s320x320&_nc_cat=111&ccb=1-7&_nc_sid=2b6aad&_nc_ohc=i3JyyOmw0B0AX9xslvR&_nc_ht=scontent.fsgn3-1.fna&oh=00_AfBYMGvrA3cGTvfGGX_oUXHZRnPQS2sQipFFKhar9TLx9w&oe=64E0EB9D",
    }

    // Background Color & Scroll

    const [bgColor, setBgColor] = useState(false);
    const location = useLocation();
    const bgTrans = (location.pathname === '/' || location.pathname === '/login');

    useEffect(() => {
        const handleScroll = () => {
            if (window.scrollY > 0) {
                setBgColor(true);
            } else {
                setBgColor(false);
            }
        };

        window.addEventListener('scroll', handleScroll);

        return () => {
            window.removeEventListener('scroll', handleScroll);
        };
    }, []);

    return (
        <>
            <div className={`${bgTrans ? (bgColor ? "bg-header" : "header") : "bg-header"}`} >
                <Navbar
                    fluid
                    rounded className="py-5 bg-transparent">
                    <Navbar.Brand className="mr-5">
                        <Link to="/">
                            <img
                                alt="Flowbite React Logo"
                                className="mr-3 h-6 sm:h-9"
                                src={imgLogo}
                            />
                        </Link>
                        <Link to="/">
                            <p className="self-center whitespace-nowrap text-2xl text-blueTemplate font-bold dark:text-white">
                                Oupia
                            </p>
                        </Link>
                    </Navbar.Brand>
                    {!user ? (<div className="flex md:order-2 items-center">
                        <Link to="/register" className="mr-5">
                            Đăng ký
                        </Link>
                        <Link to="/login">
                            <Button color="dark">Đăng nhập</Button>
                        </Link>
                    </div>) : (<div className="flex md:order-2 items-center">
                        <BsBookmark color="white" size="20" className="mr-4" />
                        <BsChat color="white" size="20" className="mr-4" />
                        <BiBell color="white" size="24" className="mr-4" />
                        <Dropdown
                            arrowIcon={null}
                            inline
                            label={<Avatar className="w-15 h-15" alt="User Avatar" img={user.avatar} rounded />}
                            className="right-0"
                        >
                            <Dropdown.Header>
                                <span className="block text-sm">
                                    {user.fullName}
                                </span>
                            </Dropdown.Header>
                            <p className="block">
                                Trang cá nhân
                            </p>
                            <p>
                                Cài đặt
                            </p>
                            <p>

                            </p>
                            <Dropdown.Divider />
                            <div className="items-center justify-center flex p-2">
                                <FiLogOut size="20"/>
                                <p className="font-thin text-sm">Đăng xuất</p>
                            </div>
                        </Dropdown>
                    </div>)}


                    <Navbar.Collapse >
                        <NavLink to="/" className="nav-item text-lg">
                            Trang chủ
                        </NavLink>
                        <NavLink to="/find" className="nav-item text-lg">
                            Tìm phòng
                        </NavLink>

                        <NavLink to="/upload" className="nav-item text-lg">
                            Đăng tin
                        </NavLink>

                        <NavLink to="/upload" className="nav-item text-lg">
                            Pricing
                        </NavLink>
                        <NavLink to="/upload" className="nav-item text-lg">
                            Contact
                        </NavLink>
                    </Navbar.Collapse>
                </Navbar>
            </div>
            {bgTrans ? <></> : <div className="py-9"></div>}
        </>

    );
};

export default Header;
